const inputData = $input.first()?.json;

if (!inputData || !inputData.propertyName) {
 console.log('Express Consumer: Nenhuma mensagem na fila');
 return []; // Termina execução sem erro
}
// Parse da mensagem da fila
const queueData = $input.first().json.propertyName || '{}';
const messageData = queueData.originalMessage;
const classification = queueData.classification;
const routing = queueData.routing;

// Capturar tempo de início
const startTime = Date.now();

// Normalizar número de telefone
function normalizePhoneNumber(phoneNumber) {
  const cleanNumber = phoneNumber.split('@')[0];
  // Remove 9 extra de números brasileiros: 5585999028259 -> 558599028259
  return cleanNumber.replace(/^(55\d{2})9(\d{8})$/, '$1$2');
}

// Extrair dados da imagem
const imageData = messageData.imageMessage || messageData.message?.imageMessage;
const imageCaption = messageData.imageCaption || messageData.message?.imageMessage?.caption || '';
const normalizedPhone = normalizePhoneNumber(messageData.phoneNumber);

// Determinar tipo de análise de imagem
function analyzeVisionRequest(caption, imageData) {
  const lowerCaption = (caption || '').toLowerCase().trim();

  // Tipos de análise de visão
  const analysisType = {
    FOOD_IDENTIFICATION: 'identificacao_alimento',
    MEAL_ANALYSIS: 'analise_prato',
    PORTION_ESTIMATION: 'estimativa_porcao',
    NUTRITION_BREAKDOWN: 'quebra_nutricional',
    MEAL_LOGGING: 'registro_refeicao'
  };

  // Detectar intenção baseada na legenda
  if (/(quanto|quantas|calorias|kcal|valor nutricional)/i.test(lowerCaption)) {
    return {
      type: analysisType.NUTRITION_BREAKDOWN,
      complexity: 'high',
      estimatedTokens: 3500
    };
  }

  if (/(porção|quantidade|tamanho|peso)/i.test(lowerCaption)) {
    return {
      type: analysisType.PORTION_ESTIMATION,
      complexity: 'medium',
      estimatedTokens: 2500
    };
  }

  if (/(o que é|que comida|identifica|reconhece)/i.test(lowerCaption)) {
    return {
      type: analysisType.FOOD_IDENTIFICATION,
      complexity: 'medium',
      estimatedTokens: 2000
    };
  }

  if (/(comi|almocei|jantei|lanchei|registra)/i.test(lowerCaption)) {
    return {
      type: analysisType.MEAL_LOGGING,
      complexity: 'high',
      estimatedTokens: 4000
    };
  }

  // Default para análise completa do prato
  return {
    type: analysisType.MEAL_ANALYSIS,
    complexity: 'high',
    estimatedTokens: 3000
  };
}

// Extrair contexto temporal
function extractTimeContext(caption) {
  const now = new Date();
  const hour = now.getHours();

  // Detectar tipo de refeição por horário se não especificado
  let mealType = null;
  if (/(café da manhã|manhã)/i.test(caption)) mealType = 'cafe_manha';
  else if (/(almoço|meio dia)/i.test(caption)) mealType = 'almoco';
  else if (/(lanche|tarde)/i.test(caption)) mealType = 'lanche';
  else if (/(jantar|janta|noite)/i.test(caption)) mealType = 'jantar';
  else {
    // Inferir por horário
    if (hour >= 5 && hour < 10) mealType = 'cafe_manha';
    else if (hour >= 10 && hour < 15) mealType = 'almoco';
    else if (hour >= 15 && hour < 19) mealType = 'lanche';
    else mealType = 'jantar';
  }

  return {
    mealType: mealType,
    timeOfDay: now.toLocaleTimeString('pt-BR', { hour: '2-digit', minute: '2-digit' }),
    dayPeriod: hour < 12 ? 'manhã' : hour < 18 ? 'tarde' : 'noite'
  };
}

const visionAnalysis = analyzeVisionRequest(imageCaption, imageData);
const timeContext = extractTimeContext(imageCaption);

// Verificar se há dados de imagem válidos
if (!imageData || !imageData.url) {
  throw new Error('Imagem não encontrada ou inválida');
}

return [{
  json: {
    queueData: queueData,
    messageData: messageData,
    imageData: imageData,
    imageCaption: imageCaption,
    visionAnalysis: visionAnalysis,
    timeContext: timeContext,
    startTime: startTime,
    needsGPTVision: true,
    normalizedPhone: normalizedPhone,
    whatsappNumber: normalizedPhone
  }
}];

// Processar resposta do GPT Vision e extrair dados estruturados
const gptResponse = $input.first().json.content;
const visionData = $('Prepare Vision Prompt').first().json;

// Função para extrair informações nutricionais diretamente do texto
const extractNutritionFromText = (text) => {
  // Procurar valores nutricionais no formato do exemplo
  const caloriesMatch = text.match(/\*\*Calorias:\*\*\s*(\d+)\s*kcal/i) || text.match(/(\d+)\s*kcal/i);
  const proteinMatch = text.match(/\*\*Proteínas:\*\*\s*(\d+(?:\.\d+)?)\s*g/i) || text.match(/(\d+(?:\.\d+)?)\s*g.*?prote/i);
  const carbsMatch = text.match(/\*\*Carboidratos:\*\*\s*(\d+(?:\.\d+)?)\s*g/i) || text.match(/(\d+(?:\.\d+)?)\s*g.*?carb/i);
  const fatMatch = text.match(/\*\*Gorduras:\*\*\s*(\d+(?:\.\d+)?)\s*g/i) || text.match(/(\d+(?:\.\d+)?)\s*g.*?gord/i);
  const fiberMatch = text.match(/\*\*Fibras:\*\*\s*(\d+(?:\.\d+)?)\s*g/i) || text.match(/(\d+(?:\.\d+)?)\s*g.*?fibra/i);

  return {
    calories: caloriesMatch ? parseFloat(caloriesMatch[1]) : 0,
    protein: proteinMatch ? parseFloat(proteinMatch[1]) : 0,
    carbs: carbsMatch ? parseFloat(carbsMatch[1]) : 0,
    fat: fatMatch ? parseFloat(fatMatch[1]) : 0,
    fiber: fiberMatch ? parseFloat(fiberMatch[1]) : 0
  };
};

// Função para extrair alimentos com valores nutricionais individuais
const extractFoodItemsWithNutrition = (text) => {
  const foodItems = [];

  // Lista de macronutrientes para EXCLUIR
  const macronutrients = ['calorias', 'proteínas', 'carboidratos', 'gorduras', 'fibras', 'totais nutricionais'];

  // Padrão melhorado para capturar o formato específico do prompt:
  // 🍗 **Frango:** 120g (165 kcal, 31g prot, 0g carb, 4g gord)
  const improvedFoodPattern = /([🍗🍝🥗🍖🍞🥑🌾🍎🥕🥬🧄🫘🥔🍅🍚🥩🐟🥪🍲🥘🍛🥙🌮🌯🥞🧇🥯🥖🍕🌭🍔🥨🥚🧀🥛])\s*\*\*([^:*]+):\*\*\s*([^(]+)\(([^)]+)\)/g;

  let match;
  while ((match = improvedFoodPattern.exec(text)) !== null) {
    const emoji = match[1];
    const name = match[2].trim();
    const quantity = match[3].trim();
    const nutritionText = match[4];

    // Verificar se NÃO é um macronutriente
    const isFood = !macronutrients.some(macro => 
      name.toLowerCase().includes(macro.toLowerCase())
    );

    if (isFood) {
      // Extrair valores nutricionais do texto entre parênteses
      const calories = extractValueFromNutritionText(nutritionText, ['kcal', 'cal']);
      const protein = extractValueFromNutritionText(nutritionText, ['prot', 'proteína']);
      const carbs = extractValueFromNutritionText(nutritionText, ['carb', 'carboidrato']);
      const fat = extractValueFromNutritionText(nutritionText, ['gord', 'gordura', 'fat']);
      const fiber = extractValueFromNutritionText(nutritionText, ['fibra', 'fiber']);

      foodItems.push({
        name: name,
        quantity: quantity,
        emoji: emoji,
        calories: calories,
        protein: protein,
        carbs: carbs,
        fat: fat,
        fiber: fiber
      });
    }
  }

  // Se não encontrou com o padrão melhorado, usar o padrão antigo
  if (foodItems.length === 0) {
    const detailedFoodPattern = /([🍗🍝🥗🍖🍞🥑🌾🍎🥕🥬🧄🫘🥔🍅🍚🥩🐟🥪🍲🥘🍛🥙🌮🌯🥞🧇🥯🥖🍕🌭🍔🥨🥚🧀🥛])\s*\*\*([^:*]+):\*\*\s*([^\n]*?)(?:\((\d+)\s*kcal[^)]*\))?/g;

    while ((match = detailedFoodPattern.exec(text)) !== null) {
      const name = match[2].trim();
      const quantity = match[3].trim();
      const emoji = match[1];
      const calories = match[4] ? parseFloat(match[4]) : 0;

      // Verificar se NÃO é um macronutriente
      const isFood = !macronutrients.some(macro => 
        name.toLowerCase().includes(macro.toLowerCase())
      );

      if (isFood) {
        // Tentar extrair valores nutricionais específicos do texto do alimento
        const itemText = match[0];
        const itemProtein = extractNutrientFromItemText(itemText, 'protein');
        const itemCarbs = extractNutrientFromItemText(itemText, 'carbs');
        const itemFat = extractNutrientFromItemText(itemText, 'fat');
        const itemFiber = extractNutrientFromItemText(itemText, 'fiber');

        foodItems.push({
          name: name,
          quantity: quantity,
          emoji: emoji,
          calories: calories,
          protein: itemProtein,
          carbs: itemCarbs,
          fat: itemFat,
          fiber: itemFiber
        });
      }
    }
  }

  // Se ainda não encontrou alimentos com emoji, procurar alimentos conhecidos no texto
  if (foodItems.length === 0) {
    const commonFoods = [
      { pattern: /\b(?:frango|chicken)\b/gi, name: 'Frango', emoji: '🍗' },
      { pattern: /\b(?:macarrão|pasta|penne|espaguete)\b/gi, name: 'Macarrão', emoji: '🍝' },
      { pattern: /\b(?:arroz|rice)\b/gi, name: 'Arroz', emoji: '🍚' },
      { pattern: /\b(?:feijão|beans)\b/gi, name: 'Feijão', emoji: '🫘' },
      { pattern: /\b(?:carne|meat|beef)\b/gi, name: 'Carne', emoji: '🥩' },
      { pattern: /\b(?:peixe|fish)\b/gi, name: 'Peixe', emoji: '🐟' },
      { pattern: /\b(?:salada|salad)\b/gi, name: 'Salada', emoji: '🥗' },
      { pattern: /\b(?:batata|potato)\b/gi, name: 'Batata', emoji: '🥔' }
    ];

    commonFoods.forEach(food => {
      if (food.pattern.test(text)) {
        const alreadyExists = foodItems.some(item => 
          item.name.toLowerCase() === food.name.toLowerCase()
        );

        if (!alreadyExists) {
          foodItems.push({
            name: food.name,
            quantity: '1 porção',
            emoji: food.emoji,
            calories: 0,
            protein: 0,
            carbs: 0,
            fat: 0,
            fiber: 0
          });
        }
      }
    });
  }

  return foodItems;
};

// Função auxiliar para extrair valores do texto nutricional
const extractValueFromNutritionText = (nutritionText, keywords) => {
  for (const keyword of keywords) {
    // Procurar padrão: número + g/kcal + keyword
    const pattern = new RegExp(`(\\d+(?:\\.\\d+)?)\\s*(?:g|kcal)?\\s*${keyword}`, 'i');
    const match = nutritionText.match(pattern);
    if (match) {
      return parseFloat(match[1]);
    }

    // Procurar padrão: keyword + número
    const reversePattern = new RegExp(`${keyword}\\s*(\\d+(?:\\.\\d+)?)`, 'i');
    const reverseMatch = nutritionText.match(reversePattern);
    if (reverseMatch) {
      return parseFloat(reverseMatch[1]);
    }
  }
  return 0;
};

// Função auxiliar para extrair nutrientes específicos do texto de um alimento
const extractNutrientFromItemText = (itemText, nutrientType) => {
  const patterns = {
    protein: /(\d+(?:\.\d+)?)\s*g.*?prote/i,
    carbs: /(\d+(?:\.\d+)?)\s*g.*?carb/i,
    fat: /(\d+(?:\.\d+)?)\s*g.*?gord/i,
    fiber: /(\d+(?:\.\d+)?)\s*g.*?fibra/i
  };

  const match = itemText.match(patterns[nutrientType]);
  return match ? parseFloat(match[1]) : 0;
};

// Extrair dados nutricionais do texto
const nutrition = extractNutritionFromText(gptResponse);
const foodItems = extractFoodItemsWithNutrition(gptResponse);

// Se os alimentos não têm valores nutricionais individuais, usar estimativa inteligente
if (foodItems.length > 0) {
  const totalItemCalories = foodItems.reduce((sum, item) => sum + item.calories, 0);

  // Se nenhum alimento tem calorias individuais, mas temos total
  if (totalItemCalories === 0 && nutrition.calories > 0) {
    // Usar estimativas baseadas no tipo de alimento
    const foodNutritionEstimates = {
      'frango': { caloriesPerPortion: 165, proteinRatio: 0.31, carbsRatio: 0, fatRatio: 0.036 },
      'macarrão': { caloriesPerPortion: 220, proteinRatio: 0.08, carbsRatio: 0.75, fatRatio: 0.011 },
      'arroz': { caloriesPerPortion: 130, proteinRatio: 0.027, carbsRatio: 0.28, fatRatio: 0.003 },
      'salada': { caloriesPerPortion: 20, proteinRatio: 0.02, carbsRatio: 0.04, fatRatio: 0.002 },
      'feijão': { caloriesPerPortion: 245, proteinRatio: 0.15, carbsRatio: 0.45, fatRatio: 0.01 },
      'carne': { caloriesPerPortion: 250, proteinRatio: 0.26, carbsRatio: 0, fatRatio: 0.17 },
      'peixe': { caloriesPerPortion: 206, proteinRatio: 0.22, carbsRatio: 0, fatRatio: 0.12 },
      'batata': { caloriesPerPortion: 161, proteinRatio: 0.02, carbsRatio: 0.37, fatRatio: 0.001 }
    };

    // Calcular estimativas para cada alimento
    let totalEstimatedCalories = 0;
    foodItems.forEach(item => {
      const foodKey = item.name.toLowerCase();
      const estimate = foodNutritionEstimates[foodKey] || { caloriesPerPortion: 100, proteinRatio: 0.1, carbsRatio: 0.2, fatRatio: 0.05 };

      item.calories = estimate.caloriesPerPortion;
      item.protein = Math.round((estimate.caloriesPerPortion * estimate.proteinRatio / 4) * 10) / 10; // 4 cal/g proteína
      item.carbs = Math.round((estimate.caloriesPerPortion * estimate.carbsRatio / 4) * 10) / 10; // 4 cal/g carbs
      item.fat = Math.round((estimate.caloriesPerPortion * estimate.fatRatio / 9) * 10) / 10; // 9 cal/g gordura
      item.fiber = Math.round((item.carbs * 0.1) * 10) / 10; // Estimativa de fibra

      totalEstimatedCalories += item.calories;
    });

    // Ajustar proporcionalmente se o total estimado for muito diferente do real
    if (Math.abs(totalEstimatedCalories - nutrition.calories) > 50) {
      const adjustmentFactor = nutrition.calories / totalEstimatedCalories;
      foodItems.forEach(item => {
        item.calories = Math.round(item.calories * adjustmentFactor);
        item.protein = Math.round((item.protein * adjustmentFactor) * 10) / 10;
        item.carbs = Math.round((item.carbs * adjustmentFactor) * 10) / 10;
        item.fat = Math.round((item.fat * adjustmentFactor) * 10) / 10;
        item.fiber = Math.round((item.fiber * adjustmentFactor) * 10) / 10;
      });
    }
  }
}

// Se não encontrou alimentos, criar um genérico
if (foodItems.length === 0) {
  foodItems.push({
    name: 'Refeição analisada',
    quantity: '1 porção',
    emoji: '🍽️',
    calories: nutrition.calories,
    protein: nutrition.protein,
    carbs: nutrition.carbs,
    fat: nutrition.fat,
    fiber: nutrition.fiber
  });
}

// Criar estrutura meal_data padronizada
const structuredData = {
  meal_data: {
    calories: nutrition.calories,
    protein: nutrition.protein,
    carbs: nutrition.carbs,
    fat: nutrition.fat,
    fiber: nutrition.fiber,
    food_items: foodItems
  }
};

// Preparar resposta limpa para o usuário (remover JSON se houver)
const cleanResponse = gptResponse.replace(/```json[\s\S]*?```/g, '').replace(/🔄\s*\*\*Dados Técnicos[\s\S]*$/i, '').trim();

// Calcular tokens usados (estimativa para Vision - mais tokens devido à imagem)
const baseTokens = Math.ceil((visionData.gptPrompt.length + gptResponse.length) / 4);
const imageTokens = 1500; // Estimativa para análise de imagem em alta resolução
const tokensUsed = baseTokens + imageTokens;

// Sempre será true agora pois criamos meal_data
const needsDbUpdate = true;

// Extrair dados de identificação de alimentos para compatibilidade
function extractFoodData(text) {
  return {
    identifiedFoods: foodItems.map(item => item.name),
    hasNutritionalData: nutrition.calories > 0
  };
}

const extractedFoodData = extractFoodData(gptResponse);

return [{
  json: {
    ...visionData,
    gptResponse: cleanResponse,
    structuredData: structuredData,
    extractedFoodData: extractedFoodData,
    tokensUsed: tokensUsed,
    needsDbUpdate: needsDbUpdate,
    analysisType: visionData.visionAnalysis.type,
    nutritionExtracted: nutrition,
    foodItemsExtracted: foodItems
  }
}];

