// Criar food_items para a refeição analisada por visão
const processedData = $('Process Vision Response').first().json;
const mealId = $('Create Meal with Image').first().json.id;
const foodItems = processedData.structuredData?.meal_data?.food_items || [];

// Verificar se temos dados válidos
if (!mealId) {
  throw new Error('meal_id não encontrado');
}

if (!foodItems || foodItems.length === 0) {
  // Se não há food_items, criar um item genérico baseado nos dados nutricionais
  const nutrition = processedData.nutritionExtracted || {};
  const genericItem = {
    meal_id: mealId,
    name: 'Refeição analisada por imagem',
    quantity: '1 porção',
    emoji: '📷',
    protein: nutrition.protein || 0,
    carbs: nutrition.carbs || 0,
    fat: nutrition.fat || 0,
    fiber: nutrition.fiber || 0,
    calories: nutrition.calories || 0,
    source: 'vision_analysis'
  };

  return [{ json: genericItem }];
}

// Preparar dados para inserção em lote
const foodItemsToInsert = foodItems.map(item => ({
  meal_id: mealId,
  name: item.name || 'Alimento não identificado',
  quantity: item.quantity || '1 porção',
  emoji: item.emoji || '📷',
  protein: parseFloat(item.protein) || 0,
  carbs: parseFloat(item.carbs) || 0,
  fat: parseFloat(item.fat) || 0,
  fiber: parseFloat(item.fiber) || 0,
  calories: parseFloat(item.calories) || 0,
  source: 'vision_analysis'
}));

// Verificar se todos os itens têm meal_id válido
const validItems = foodItemsToInsert.filter(item => item.meal_id && item.name);

if (validItems.length === 0) {
  throw new Error('Nenhum food_item válido para inserir');
}

return validItems.map(item => ({ json: item }));

// Converter imagem do WhatsApp para formato compatível com OpenAI
const visionData = $input.first().json;
const imageData = visionData.imageData;

// Função para converter base64 para data URL se necessário
function formatImageForOpenAI(imageData) {
  // Se já tem base64, usar diretamente
  if (imageData.base64) {
    // Garantir que está no formato data URL correto
    const base64Data = imageData.base64;
    const mimeType = imageData.mimetype || 'image/jpeg';

    // Se já está no formato data URL, retornar como está
    if (base64Data.startsWith('data:')) {
      return base64Data;
    }

    // Caso contrário, criar data URL
    return `data:${mimeType};base64,${base64Data}`;
  }

  // Se não tem base64, usar jpegThumbnail como fallback
  if (imageData.jpegThumbnail) {
    return `data:image/jpeg;base64,${imageData.jpegThumbnail}`;
  }

  throw new Error('Nenhum formato de imagem válido encontrado');
}

try {
  const formattedImageUrl = formatImageForOpenAI(imageData);

  return [{
    json: {
      ...visionData,
      formattedImageUrl: formattedImageUrl,
      hasValidImage: true,
      imageFormat: imageData.mimetype || 'image/jpeg'
    }
  }];
} catch (error) {
  return [{
    json: {
      ...visionData,
      formattedImageUrl: null,
      hasValidImage: false,
      imageError: error.message
    }
  }];
}

